class EventBus {
  private events: Map<string, EventCallback[]> = new Map();

  on(event: string, callback: EventCallback): () => void {
    if (!this.events.has(event)) this.events.set(event, []);
    this.events.get(event)!.push(callback);
    return () => this.off(event, callback); // Hm hy ng k
  }

  emit(event: string, data?: unknown): void {
    this.events.get(event)?.forEach(cb => cb(data));
  }
}

export const eventBus = new EventBus();`,highlightLines:[6,7,8,12,13]})]})},{id:28,title:"ng dng: ng b Token",section:"Phn 4: Communication",variant:"diagram",content:l.jsxs("div",{className:"w-full max-w-5xl mx-auto",children:[l.jsx("h2",{className:"text-slide-header mb-6",children:"V d thc t: ng b Token gia cc MFE"}),l.jsx(x1,{})]})},{id:29,title:"Vn  vi localStorage",section:"Phn 5: Security",variant:"code",content:l.jsxs("div",{className:"w-full max-w-5xl mx-auto",children:[l.jsxs("h2",{className:"text-slide-header mb-4",children:[l.jsx("span",{className:"text-[var(--accent-red)]",children:""})," Vn  bo mt vi localStorage"]}),l.jsxs("div",{className:"grid grid-cols-2 gap-4",children:[l.jsxs(M.div,{className:"glass p-5 rounded-lg border-2 border-[var(--accent-red)]/50",initial:{opacity:0},animate:{opacity:1},children:[l.jsx("h4",{className:"text-[var(--accent-red)] font-bold mb-3",children:" Nguy him: XSS c th c"}),l.jsx(we,{title:"ng lm th ny!",language:"typescript",showLineNumbers:!1,code:`// XSS attack c th c c!
